window.addEventListener("load",app);
function app() {
	var form = document.querySelector("form"),
		imgUpload = document.getElementsByName("img_upload")[0],
		imgName = document.getElementsByName("img_name")[0],
		download = document.getElementById("download"),
		canvas = document.querySelector("canvas"),
		c = canvas.getContext("2d"),
		W = 0,
		H = 0,
		img = null,

		adjustCanvas = () => {
			// restrict image size
			let imgWidth = img.width,
				imgHeight = img.height,
				sideLimit = 1024;

			// keep it proportional
			if (imgWidth >= imgHeight) {
				if (imgWidth >= sideLimit) {
					imgWidth = sideLimit;
					imgHeight = imgWidth * (img.height / img.width);
				}
			} else {
				if (imgHeight >= sideLimit) {
					imgHeight = sideLimit;
					imgWidth = imgHeight * (img.width / img.height);
				}
			}

			// update canvas
			c.clearRect(0,0,W,H);

			canvas.width = imgWidth;
			canvas.height = imgHeight;

			W = canvas.width;
			H = canvas.height;

			c.drawImage(img,0,0,imgWidth,imgHeight);
		},
		imgUploadValid = () => {
			let files = imgUpload.files,
				fileIsThere = files.length > 0,
				isImage = files[0].type.match("image.*"),
				valid = fileIsThere && isImage;

			return valid;
		},
		handleImgUpload = e => {
			return new Promise((resolve,reject) => {
				let target = !e ? imgUpload : e.target;
				if (target.files.length) {
					let reader = new FileReader();
					reader.onload = e2 => {
						img = new Image();
						img.src = e2.target.result;
						img.onload = () => {
							resolve();
						};
						img.onerror = () => {
							img = null;
							reject("Image nullified due to file corruption or non-image upload");
						};
						imgName.placeholder = target.files[0].name;
					};
					reader.readAsDataURL(target.files[0]);
				}
			});
		},
		enableDownload = () => {
			download.classList.remove("disabled");
		},
		RGBToHSL = (R,G,B) => {
			let r = R / 255,
				g = G / 255,
				b = B / 255,
				cmin = Math.min(r,g,b),
				cmax = Math.max(r,g,b),
				delta = cmax - cmin,
				hue = 0,
				sat = 0,
				light = 0;

			// get hue
			if (delta == 0)
				hue = 0;
			else if (cmax == r)
				hue = ((g - b) / delta) % 6;
			else if (cmax == g)
				hue = (b - r) / delta + 2;
			else
				hue = (r - g) / delta + 4;

			hue = Math.round(hue * 60);

			if (hue < 0)
				hue += 360;

			// get lightness and saturation
			light = (cmax + cmin) / 2;
			sat = delta == 0 ? 0 : delta / (1 - Math.abs(2 * light - 1));

			sat = Math.round(sat * 100);
			light = Math.round(light * 100);

			return {h: hue, s: sat, l: light};
		},
		HSLToRGB = (H,S,L) => {
			let s = S / 100,
				l = L / 100,
				c = (1 - Math.abs(2 * l - 1)) * s,
				x = c * (1 - Math.abs((H / 60) % 2 - 1)),
				m = l - c/2,
				r = 0,
				g = 0,
				b = 0;

			if (0 <= H && H < 60) {
				r = c; g = x; b = 0;

			} else if (60 <= H && H < 120) {
				r = x; g = c; b = 0;

			} else if (120 <= H && H < 180) {
				r = 0; g = c; b = x;

			} else if (180 <= H && H < 240) {
				r = 0; g = x; b = c;

			} else if (240 <= H && H < 300) {
				r = x; g = 0; b = c;

			} else if (300 <= H && H < 360) {
				r = c; g = 0; b = x;
			}

			r = Math.round((r + m) * 255);
			g = Math.round((g + m) * 255);
			b = Math.round((b + m) * 255);

			return {r: r, g: g, b: b};
		},
		render = () => {
			let imgData = c.getImageData(0,0,W,H),
				data = imgData.data;

			for (var i = 0; i < data.length; i += 4) {
				let inHSL = RGBToHSL(data[i],data[i + 1],data[i + 2]),
					newHue = inHSL.l > 50 ? 30 : 210,
					newSat = 100,
					newLight = Math.floor(inHSL.l / 20) * 20 + 10,
					backToRGB = HSLToRGB(newHue,newSat,newLight);

				data[i] = backToRGB.r;
				data[i + 1] = backToRGB.g;
				data[i + 2] = backToRGB.b;
			}
			c.putImageData(imgData,0,0);
		},
		renderPromise = e => {
			handleImgUpload(e).then(() => {
				if (imgUploadValid()) {
					adjustCanvas();
					render();
					enableDownload();
				}
					
			}).catch(msg => {
				console.log(msg);
			});
		};

	imgUpload.addEventListener("change",renderPromise);
	download.addEventListener("click",function(e){
		if (!this.classList.contains("disabled")) {
			let dlData = canvas.toDataURL("image/png");
			this.href = dlData;
			
		} else {
			e.preventDefault();
		}
	});

	// deal with preserved input
	if (imgUpload.value != "") {
		renderPromise();
	} else {
		// or start with sample (apologies for the long data URI; CORS hates it when externally-hosted images on canvas are tainted)
		img = new Image();
		img.src = "data:image/jpeg;base64,";
		img.onload = e => {
			adjustCanvas();
			render();
			enableDownload();
		}
	}
}